import React, { useRef } from 'react';
import { Link } from 'react-router-dom';
import './NavigationBar.css';

const NavigationBar = () => {
  const fileInputRef = useRef(null);
  const [isLoading, setIsLoading] = useState(false);
  const [capturedImage, setCapturedImage] = useState(null);
  const [result, setResult] = useState(null);

  const handleCameraClick = () => {
    fileInputRef.current.click(); // ÌååÏùº ÏûÖÎ†• Ï∞Ω Ïó¥Í∏∞
  };

  const handleFileChange = async (event) => {
    const file = event.target.files[0];
    if (file) {
      const imageUrl = URL.createObjectURL(file); // Ïù¥ÎØ∏ÏßÄ URL ÏÉùÏÑ±
      setCapturedImage(imageUrl); // Ïù¥ÎØ∏ÏßÄ ÎØ∏Î¶¨Î≥¥Í∏∞
      setIsLoading(true); // Î°úÎî© ÏãúÏûë

      // AI Î∂ÑÏÑù ÏãúÎÆ¨Î†àÏù¥ÏÖò (3Ï¥à ÏßÄÏó∞ ÌõÑ Í≤∞Í≥º ÌëúÏãú)
      setTimeout(() => {
        setResult("AI Î∂ÑÏÑù Í≤∞Í≥º: ÌîºÏûê üçï"); // AI Í≤∞Í≥º ÏòàÏãú
        setIsLoading(false); // Î°úÎî© Ï¢ÖÎ£å
      }, 3000);
    }
  };

  return (
    <div className="navigation-bar">
      {/* ÏôºÏ™Ω ÏÑπÏÖò: ÏãùÎã®, ÏäµÍ¥Ä */}
      <div className="nav-left">
        <Link to="/nutrition" className="nav-item">
          <img src="/nutrition-icon.png" alt="ÏãùÎã®" className="nav-icon" />
          <span className="nav-label">ÏãùÎã®</span>
        </Link>
        <Link to="/habit" className="nav-item">
          <img src="/habit-icon.png" alt="ÏäµÍ¥Ä" className="nav-icon" />
          <span className="nav-label">ÏäµÍ¥Ä</span>
        </Link>
      </div>

      {/* Ï§ëÏïô ÏÑπÏÖò: Ïπ¥Î©îÎùº */}
      <div className="nav-center">
        <button className="camera-button" onClick={handleCameraClick}>
          <img src="/camera-icon.png" alt="Ïπ¥Î©îÎùº" className="camera-icon" />
        </button>
        <input
          type="file"
          accept="image/*"
          capture="camera" // Ïπ¥Î©îÎùº Ìò∏Ï∂ú
          style={{ display: 'none' }} // Ïà®Í≤®ÏßÑ input
          ref={fileInputRef}
          onChange={handleFileChange}
        />
      </div>

      {/* Î°úÎî© ÌôîÎ©¥ */}
      {isLoading && (
        <div className="loading-screen">
          <p>AIÍ∞Ä Ïù¥ÎØ∏ÏßÄÎ•º Î∂ÑÏÑù Ï§ëÏûÖÎãàÎã§...</p>
          <div className="spinner"></div>
        </div>
      )}

       {/* AI Î∂ÑÏÑù Í≤∞Í≥º ÌëúÏãú */}
       {result && !isLoading && (
        <div className="result-screen">
          <p>{result}</p>
          <img
            src={capturedImage}
            alt="Captured"
            className="captured-image"
            style={{ maxWidth: "100%", margin: "10px 0" }}
          />
        </div>
      )}


      {/* Ïò§Î•∏Ï™Ω ÏÑπÏÖò: ÎßàÏù¥ÌéòÏù¥ÏßÄ */}
      <div className="nav-right">
        <Link to="/mypage" className="nav-item">
          <img src="/mypage-icon.png" alt="ÎßàÏù¥ÌéòÏù¥ÏßÄ" className="nav-icon" />
          <span className="nav-label">ÎßàÏù¥ÌéòÏù¥ÏßÄ</span>
        </Link>
        <Link to="/contact" className="nav-item">
          <img src="/contact-icon.png" alt="Î¨∏ÏùòÌïòÍ∏∞" className="nav-icon" />
          <span className="nav-label">Î¨∏Ïùò</span>
        </Link>
      </div>
    </div>
  );
};

export default NavigationBar;
